  \"A Reinforcement for Multifunctional Composites for Non-Parasitic Radiation Shielding
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T22:02:11.328684\",\n\t\"name\":
  \"a-reinforcement-for-multifunctional-composites-for-non-parasitic-radiation-shielding-proje-62f8d\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Innovative lightweight radiation shielding
  materials are enabling to shield humans in aerospace transportation vehicles and
  other human habited spaces. Multifunctional materials which provide non-parasitic
  shielding as well as structural performance is needed.  Boron can provide neutron
  and cosmic radiation shielding, but the only available boron fiber is a large diameter
  monofianant on a tungsten substrate whose high Z number preclude it use in radiation
  applications.  This program will develop boron fibers on carbon (low Z no.) fiber
  tow substrate utilizing an existing system for spreading carbon fiber tow and chemically
  vapor depositing (CVD) coatings.  Processing will be optimized to produce high strength
  boron fiber tow which will be utilized in select polymer matrix composites to demonstrate
  the multifunctionality of structural and radiation shielding.\",\n\t\"license_title\":
